import React, { useState } from "react";
import Sidebar from "../components/Sidebar";
import Footer from "../components/Footer";

const MyFavorites = () => {
  const [selectedAds, setSelectedAds] = useState([]);

  const favoriteAds = [
    {
      id: 1,
      name: "Modern Kitchen",
      date: "Nov-25-2019 , 16:54 pm",
      category: "Apartments",
      price: "$89",
      status: "Active",
      img: "https://images.unsplash.com/photo-1600585154340-be6161a56a0c",
      type: "Sale",
    },
    {
      id: 2,
      name: "Villa",
      date: "Nov-22-2019 , 9:18 am",
      category: "Homes",
      price: "$14,000",
      status: "Closed",
      img: "https://images.unsplash.com/photo-1560448075-bb485b65be14",
      type: "Sale",
    },
    {
      id: 3,
      name: "2BHK Rooms",
      date: "Nov-15-2019 , 12:45 pm",
      category: "RealEstate",
      price: "$22,765",
      status: "Sold",
      img: "https://images.unsplash.com/photo-1507089947368-19c1da9775ae",
      type: "Buy",
    },
    {
      id: 4,
      name: "Luxury Rooms",
      date: "Nov-03-2019 , 12:50 pm",
      category: "Deluxe Houses",
      price: "$35,978",
      status: "Inactive",
      img: "https://images.unsplash.com/photo-1505692794403-34cb0b3b8bd1",
      type: "Sale",
    },
  ];

  const handleSelect = (id) => {
    setSelectedAds((prev) =>
      prev.includes(id)
        ? prev.filter((item) => item !== id)
        : [...prev, id]
    );
  };

  return (
    <div className="min-h-screen bg-[#0a1124] text-white pt-24 px-4 md:px-0">
      {/* MAIN LAYOUT */}
      <div className="flex flex-col md:flex-row gap-6 max-w-7xl mx-auto">
        {/* SIDEBAR */}
        <Sidebar />

        {/* RIGHT CONTENT */}
        <div className="flex-1 bg-[#111827] p-4 md:p-6 rounded-xl shadow-lg overflow-x-auto">
          <h2 className="text-2xl md:text-3xl font-semibold mb-4 md:mb-6">
            My Favorite Ads
          </h2>

          <div className="overflow-x-auto">
            <table className="min-w-[600px] md:min-w-full border-separate border-spacing-0 rounded-lg overflow-hidden">
  <thead className="bg-[#1b2339] text-gray-300 text-sm md:text-base">
    <tr>
      <th className="p-3 text-left">‚úî</th>
      <th className="p-3 text-left">Item</th>
      <th className="p-3 text-left">Category</th>
      <th className="p-3 text-left">Price</th>
      <th className="p-3 text-left">Ad Status</th>
      <th className="p-3 text-left">Action</th>
    </tr>
  </thead>

  <tbody>
    {favoriteAds.map((ad, index) => (
      <tr
        key={ad.id}
        className={`hover:bg-[#1a2136] transition ${
          index % 2 === 0 ? "bg-[#111827]" : "bg-[#121b2e]"
        }`}
      >
        {/* Checkbox */}
        <td className="p-3 text-center border-b border-gray-700">
          <input
            type="checkbox"
            checked={selectedAds.includes(ad.id)}
            onChange={() => handleSelect(ad.id)}
            className="w-5 h-5 text-blue-500 bg-gray-800 border-gray-600 rounded"
          />
        </td>

        {/* Item */}
        <td className="p-3 flex items-center gap-3 border-b border-gray-700">
          <img
            src={ad.img}
            alt={ad.name}
            className="w-16 h-16 rounded-lg object-cover border border-gray-700"
          />
          <div>
            <p className="font-semibold">{ad.name}</p>
            <p className="text-sm text-gray-400">{ad.date}</p>
            <p className="text-sm text-gray-400">üè∑ {ad.type}</p>
          </div>
        </td>

        {/* Category */}
        <td className="p-3 border-b border-gray-700">{ad.category}</td>

        {/* Price */}
        <td className="p-3 font-semibold border-b border-gray-700">{ad.price}</td>

        {/* Status */}
        <td className="p-3 border-b border-gray-700">
          <span
            className={`px-3 py-1 rounded text-sm font-semibold ${
              ad.status === "Active"
                ? "bg-green-700"
                : ad.status === "Sold"
                ? "bg-blue-700"
                : ad.status === "Closed"
                ? "bg-red-700"
                : "bg-purple-700"
            }`}
          >
            {ad.status}
          </span>
        </td>

        {/* Action */}
        <td className="p-3 flex gap-3 border-b border-gray-700">
          <button className="p-2 bg-red-600 hover:bg-red-700 rounded transition">
            üóë
          </button>
          <button className="p-2 bg-blue-600 hover:bg-blue-700 rounded transition">
            üõí
          </button>
        </td>
      </tr>
    ))}
  </tbody>
</table>

          </div>
        </div>
      </div>

      {/* FOOTER */}
      <div className="mt-10">
        <Footer />
      </div>
    </div>
  );
};

export default MyFavorites;
